import { SmallVideoCard } from "../../card/small-video-card";

const ShowPlaylist = () => {
  return (
    <div className="show-playlist flex-r-w m-up-6 p-up-6">
      <div className="playlist-name-disc m-r-6">
        <div className="textbox">
          <div className="title is-5">Playlist Name</div>
          <div className="subtitle is-3">lorem</div>
        </div>
      </div>
      <div className="playlist-videos flex-c-w">
        <SmallVideoCard />
        <SmallVideoCard />
        <SmallVideoCard />
      </div>
    </div>
  );
};

export { ShowPlaylist };
